d.Shaders.registerSnippet("light_structs","\n\t#ifndef SB_LIGHT_STRUCTS\n\t#define SB_LIGHT_STRUCTS\n\tuniform lowp vec4 u_light_info;\n\tuniform vec3 u_light_position;\n\tuniform vec3 u_light_front;\n\tuniform vec3 u_light_color;\n\tuniform vec4 u_light_angle; //cone start,end,phi,theta \n\tuniform vec4 u_light_att; //start,end \n\tuniform float u_light_offset; //ndotl offset\n\tuniform vec4 u_light_extra; //user data\n\tuniform mat4 u_light_matrix; //projection to light screen space\n\tuniform vec3 u_ambient_light;\n\tstruct Light {\n\t\tlowp vec4 Info; //type of light (3: DIRECTIONAL), falloff type, pass index, num passes \n\t\tvec3 Color;\n\t\tvec3 Ambient;\n\t\tvec3 Position;\n\t\tvec3 Front;\n\t\tvec4 ConeInfo; //for spotlights\n\t\tvec4 Attenuation; //start,end,type,extra\n\t\tfloat Offset; //phong_offset\n\t\tvec4 Extra; //users can use this\n\t\tmat4 Matrix; //converts to light space\n\t\tfloat Distance;\n\t};\n\t//Returns the info about the light\n\tLight getLight()\n\t{\n\t\tLight LIGHT;\n\t\tLIGHT.Info = u_light_info;\n\t\tLIGHT.Color = u_light_color;\n\t\tif(u_light_info.z == 0.0)\n\t\t\tLIGHT.Ambient = u_ambient_light;\n\t\telse\n\t\t\tLIGHT.Ambient = vec3(0.0);\n\t\tLIGHT.Position = u_light_position;\n\t\tLIGHT.Front = u_light_front;\n\t\tLIGHT.ConeInfo = u_light_angle; //for spotlights\n\t\tLIGHT.Attenuation = u_light_att; //start and end\n\t\tLIGHT.Offset = u_light_offset;\n\t\tLIGHT.Distance = length( u_light_position - v_pos );\n\t\tLIGHT.Extra = u_light_extra;\n\t\tLIGHT.Matrix = u_light_matrix; //converts to light space\n\t\treturn LIGHT;\n\t}\n\t//used to store light contribution\n\tstruct FinalLight {\n\t\tvec3 Color;\n\t\tvec3 Ambient;\n\t\tfloat Diffuse; //NdotL\n\t\tfloat Specular; //RdotL\n\t\tvec3 Emission;\n\t\tvec3 Reflection;\n\t\tfloat Attenuation;\n\t\tvec3 Vector; //light vector\n\t\tfloat Shadow; //1.0 means fully lit\n\t};\n\t#endif\n");
w._vs_shaderblock_code='\n\t#pragma shaderblock "testShadow"\n';w._enabled_fs_shaderblock_code='\n\t#pragma snippet "input"\n\t#pragma snippet "surface"\n\t#pragma snippet "light_structs"\n\t#pragma snippet "spotFalloff"\n\t#pragma shaderblock "firstPass"\n\t#pragma shaderblock "lastPass"\n\t#pragma shaderblock "applyIrradiance"\n\t#pragma shaderblock "attenuation"\n\t#pragma shaderblock "testShadow"\n\t\n\t//Light is separated in two functions, computeLight (how much light receives the object) and applyLight (compute resulting final color)\n\t// FINAL LIGHT EQUATION, takes all the info from FinalLight and computes the final color \n\t\n\t// HERE we fill FinalLight structure with all the info (colors,NdotL,diffuse,specular,etc) \n\tFinalLight computeLight(in SurfaceOutput o, in Input IN, in Light LIGHT )\n\t{\n\t\tFinalLight FINALLIGHT;\n\t\t// INIT\n\t\tFINALLIGHT.Color = LIGHT.Color;\n\t\t\n\t\t// COMPUTE VECTORS\n\t\tvec3 N = o.Normal; //use the final normal (should be the same as IN.worldNormal)\n\t\tvec3 E = (u_camera_eye - v_pos);\n\t\tfloat cam_dist = length(E);\n\t\tE /= cam_dist;\n\t\t\n\t\tvec3 L = (LIGHT.Position - v_pos) / LIGHT.Distance;\n\t\t\n\t\tif( LIGHT.Info.x == 3.0 )\n\t\t\tL = -LIGHT.Front;\n\t\t\n\t\tFINALLIGHT.Vector = L;\n\t\tvec3 R = reflect(E,N);\n\t\t\n\t\t// IRRADIANCE\n\t\t#ifdef BLOCK_FIRSTPASS\n\t\t\tFINALLIGHT.Ambient = LIGHT.Ambient;\n\t\t\tapplyIrradiance( IN, o, FINALLIGHT );\n\t\t#endif\n\t\t// PHONG FORMULA\n\t\tfloat NdotL = 1.0;\n\t\tNdotL = dot(N,L);\n\t\tfloat EdotN = dot(E,N); //clamp(dot(E,N),0.0,1.0);\n\t\tNdotL = NdotL + LIGHT.Offset;\n\t\tNdotL = max( 0.0, NdotL );\n\t\tFINALLIGHT.Diffuse = abs(NdotL);\n\t\tFINALLIGHT.Specular = o.Specular * pow( clamp(dot(R,-L),0.001,1.0), o.Gloss );\n\t\t\n\t\t// ATTENUATION\n\t\tFINALLIGHT.Attenuation = 1.0;\n\t\t\n\t\t#ifdef BLOCK_ATTENUATION\n\t\t\tFINALLIGHT.Attenuation = computeAttenuation( LIGHT );\n\t\t#endif\n\t\tif( LIGHT.Info.x == 2.0 && LIGHT.Info.y == 1.0 )\n\t\t\tFINALLIGHT.Attenuation *= spotFalloff( LIGHT.Front, normalize( LIGHT.Position - v_pos ), LIGHT.ConeInfo.z, LIGHT.ConeInfo.w );\n\t\t\n\t\t// SHADOWS\n\t\tFINALLIGHT.Shadow = 1.0;\n\t\t#ifdef BLOCK_TESTSHADOW\n\t\t\tFINALLIGHT.Shadow = testShadow( LIGHT );\n\t\t#endif\n\t\t\n\t\t// LIGHT MODIFIERS\n\t\t#ifdef LIGHT_MODIFIER\n\t\t#endif\n\t\t// FINAL LIGHT FORMULA ************************* \n\t\treturn FINALLIGHT;\n\t}\n\t//here we apply the FINALLIGHT to the SurfaceOutput\n\tvec3 applyLight( in SurfaceOutput o, in FinalLight FINALLIGHT )\n\t{\n\t\tvec3 total_light = FINALLIGHT.Ambient * o.Ambient + FINALLIGHT.Color * FINALLIGHT.Diffuse * FINALLIGHT.Attenuation * FINALLIGHT.Shadow;\n\t\tvec3 final_color = o.Albedo * total_light;\n\t\t#ifdef BLOCK_FIRSTPASS\n\t\tfinal_color += o.Emission;\n\t\t#endif\n\t\tfinal_color\t+= o.Albedo * (FINALLIGHT.Color * FINALLIGHT.Specular * FINALLIGHT.Attenuation * FINALLIGHT.Shadow);\n\t\treturn max( final_color, vec3(0.0) );\n\t}\n\t\n\t//all done in one single step\n\tvec3 processLight(in SurfaceOutput o, in Input IN, in Light LIGHT)\n\t{\n\t\tFinalLight FINALLIGHT = computeLight( o, IN,LIGHT );\n\t\treturn applyLight(o,FINALLIGHT);\n\t}\n\t\n';
w._disabled_shaderblock_code='\n\t#pragma shaderblock "firstPass"\n\t#pragma shaderblock "lastPass"\n\t#pragma snippet "input"\n\t#pragma snippet "surface"\n\t#pragma snippet "light_structs"\n\t#pragma shaderblock "applyIrradiance"\n\tFinalLight computeLight( in SurfaceOutput o, in Input IN, in Light LIGHT )\n\t{\n\t\tFinalLight FINALLIGHT;\n\t\tFINALLIGHT.Ambient = LIGHT.Ambient;\n\t\tFINALLIGHT.Diffuse = 0.0;\n\t\tFINALLIGHT.Specular = 0.0;\n\t\tFINALLIGHT.Attenuation = 0.0;\n\t\tFINALLIGHT.Shadow = 0.0;\n\t\tapplyIrradiance( IN, o, FINALLIGHT );\n\t\treturn FINALLIGHT;\n\t}\n\tvec3 applyLight( in SurfaceOutput o, in FinalLight FINALLIGHT )\n\t{\n\t\tvec3 final_color = o.Albedo * o.Ambient * FINALLIGHT.Ambient;\n\t\t#ifdef BLOCK_FIRSTPASS\n\t\tfinal_color += o.Emission;\n\t\t#endif\n\t\treturn final_color;\n\t}\n\t\n\t//all done in one single step\n\tvec3 processLight(in SurfaceOutput o, in Input IN, in Light LIGHT)\n\t{\n\t\tFinalLight FINALLIGHT = computeLight( o, IN,LIGHT );\n\t\treturn applyLight(o,FINALLIGHT);\n\t}\n\t\n';
